import React from "react";
import Navigation from '../components/nav';
import { Button } from '@material-ui/core';

export default () => {
    return (
        <div>
            <Navigation />
            <p>Cart</p>
            <style jsx global>{`
          * {
            box-sizing: border-box; 
            margin: 0;
            padding: 0;
          }
        `}</style>
        </div>
    )
}
